import React, { useContext } from 'react';
import { useNavigate } from 'react-router-dom';
import { cartStore } from './CartStore';
import { usePopup } from './PopupProvider';
import './Stores.css';  

const CatenaZapataMenu = () => {
  const navigate = useNavigate();
  const { setImages, setVisible } = usePopup();

  const menu = [
    { name: 'Catena Zapata Malbec', price: 120 ,images:["data:image/jpeg;base64,"]},
    { name: 'Catena Zapata Cabernet Sauvignon', price: 140,images:["data:image/jpeg;base64,"] },
    { name: 'Catena Zapata Chardonnay', price: 110 ,images:["data:image/jpeg;base64,"]},
    { name: 'Catena Zapata Alta Malbec', price: 180,images:["data:image/jpeg;base64,"] },
    { name: 'Catena Zapata Adrianna Vineyard', price: 250,images:["data:image/jpeg;base64,"] },
    { name: 'Catena Zapata Angelica Zapata', price: 300,images:["data:image/jpeg;base64,"] },
    { name: 'Catena Zapata Nicasia Vineyard', price: 220 ,images:["data:image/jpeg;base64,"]},
    { name: 'Catena Zapata White Stones', price: 150,images:["data:image/jpeg;base64,"] },
    { name: 'Catena Zapata La Pirámide', price: 210 ,images:["data:image/jpeg;base64,"]},
    { name: 'Catena Zapata Cabernet Franc', price: 160,images:["data:image/jpeg;base64,"] },
    { name: 'Catena Zapata Sauvignon Blanc', price: 130,images:["data:image/jpeg;base64,"] },
  ];

  const goToCart = () => {
    navigate('/cart');
  };

  const handleImage = (images) => {
    setVisible(true);
    setImages(images);
  };

  return (
    <div className="menu-container CatenaZapata-menu-container">
      <h2>Catena Zapata Menu</h2>
      <ul>
        {menu.map((item, index) => (
          <li key={index}>
            {item.name} - {item.price} ₪
            <div className="resButtons">
              {/* אם יש תמונות, הצג את כפתור הצפייה */}
              <button onClick={() => handleImage(item.images || [])}>צפה במוצר</button>
              <button onClick={() => cartStore.addItem(item)}>+</button>
            </div>
          </li>
        ))}
      </ul>
      <button className="go-to-cart-button" onClick={goToCart}>Go to Cart</button>
    </div>
  );
};

export default CatenaZapataMenu;
